function Post (props){
    // console.log(props);
    return(
        <div>
            <h1>Title</h1>
            {!props.data ? <h2>Loding</h2> : <div>
                {props.data.map((item)=>{
                  return <h3 key={item.id}>{item.title}</h3>
                })}

                <button onClick={props.onchenge} >click For chenge</button>
                </div>}
        </div>
    )
}
export default Post
